// Home.js
import React from 'react';
import Header from '../../components/header/Header';
import Footer from '../../components/footer/Footer';
import Background from '../../components/background/Background';
import './Home.scss';

const Home = () => {
  const backgroundLeftColor = {
    r: 0,
    g: 0,
    b: 255,
    a: 0.5,
  };
  const backgroundRightColor = 'hue-rotate(240deg)';
  const indexBackgroundColor = 'hue-rotate(190deg)';

  return (
    <Background
      backgroundLeftColor={backgroundLeftColor}
      backgroundRightColor={backgroundRightColor}
      indexBackgroundColor={indexBackgroundColor}
    >
      <Header />
      <h1>Home</h1>
      {/* Ajoutez le contenu spécifique à la page ici */}
      <Footer />
    </Background>
  );
};

export default Home;
